  return (
    <div>
      <form>
        <input type="text" onChange={props.onInputChange} value={props.inputValue1}/>
        <button type="button" onClick={props.onInputClear}>Clear</button>
        <button type="button" onClick={props.onInputDefaultText}>Text</button>
      </form>
    </div>
  )
}

export default ButtonControls
